import React from "react";
import { AppBar, Toolbar, Typography, Button, Box } from "@mui/material";
import FastfoodIcon from "@mui/icons-material/Fastfood";
import { useNavigate } from "react-router-dom";

function HotelAdmin() {
  const navigate = useNavigate();
  const username = localStorage.getItem("username") || "HotelAdmin";

  const handleLogout = () => {
    localStorage.clear();
    navigate("/login");
  };

  return (
    <>
      <AppBar position="static">
        <Toolbar>
          <Typography
            variant="h6"
            sx={{ flexGrow: 1, cursor: "pointer" }}
            onClick={() => navigate("/hoteladmin")}
            style={{fontFamily: 'Roboto', fontWeight: 'bold'}}
          >
            <FastfoodIcon sx={{mr: 1 }} />
            Food Ordering App
          </Typography>

          <Button color="inherit" onClick={() => navigate("/hoteladmin")}>Dashboard</Button>
          <Button color="inherit" onClick={() => navigate("/hoteladmin/inventory")}>Inventory</Button>
          <Button color="inherit" onClick={() => navigate("/hoteladmin/orders")}>Orders</Button>

          <Typography sx={{ mx: 2 }}>Hello, {username}</Typography>

          <Button color="inherit" onClick={handleLogout}>Logout</Button>
        </Toolbar>
      </AppBar>

      <Box sx={{ p: 3 }}>
        <Typography variant="h4" gutterBottom>Hotel Admin Dashboard</Typography>
        <Typography>Manage inventory and orders here.</Typography>
      </Box>
    </>
  );
}
export default HotelAdmin;
